import React, { useCallback, useEffect, useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import { handleError } from '../utils/ReactToastify';
import { ToastContainer } from 'react-toastify';
import '../assets/style/ReactToastifyCustom.css';
import '../assets/style/home.css';
import '../assets/style/loading.css';
import LoadingOverlay from '../components/LoadingOverlay';


const Home = ({ loggedInUser, fadeIn }) => {
    return (
        <div className={`home-page ${fadeIn ? 'fade-in' : ''}`}>
            <div className="profile-container">
                <Link to="/user-profile" className='pages-link'>
                    <div className="user-icon-image">
                        <img src='/avatar.png' className='profilePicture' alt='Profile' />
                    </div>
                </Link>
                <h1 className="user-name">{loggedInUser.name}</h1>
            </div>

            <div className="history-container">
                <h2>History</h2>
                {/* History items go here */}
            </div>

            <div className="chatbox-container">
                <div className="chatbox">
                    <p>Welcome! How can I assist you today?</p>
                    {/* Chatbox messages go here */}
                </div>
            </div>

            <div className="services-container">
                <h2>Services</h2>
                {/* Services items go here */}
            </div>

            <ToastContainer />
        </div>
    );
};

export default Home;
